import React from "react";
import { BrowserRouter as Router, withRouter, NavLink } from 'react-router-dom';
import { Nav, NavItem } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Nav id="navigation" activeKey="/default" activeHref="#"  className="navbar navbar-inverse menu-background sht-navbar">
        <div className="collapse navbar-collapse" id="myNavbar">
          <NavItem className="nav navbar-nav" as="ul">
            <NavItem title="Home" as='li'><NavLink href="#">Home</NavLink></NavItem>
          
          </NavItem>
        </div>

        <NavItem title="Home" as='li'>
          <NavLink href="#">Home</NavLink>
        </NavItem>
        <NavItem as='li'>
          <NavLink href="#">Link</NavLink>
        </NavItem>
        <NavItem as='li'>
          <NavLink href="#">Another Link</NavLink>
        </NavItem>
      </Nav>
    )
  }
} 

export default withRouter(CommunicatorNavigation);
